import React from "react";

const Restaurent = (props) => {
const {restaurent}  =props;
    return (
        <div className="row">
            {
                restaurent.map(rest => (
                    <div class="col-md-8" text-align="centre">
                        <div class="card">
                            <div class="card-body">
                                <h4>{rest.data}</h4>
                            </div>
                        </div>
                        <br></br>

                    </div>
                ))
            }

        </div>
    );
};
export default Restaurent;
